	import { createEventDispatcher } from 'svelte';

	const dispatch = createEventDispatcher();

	export let customizationChoices;

	export let width = '100%';

	let top = 'Provider';
	let middle = 'Organization';
	let bottom = 'Name';

	let arr = [];
	let placedCharacters = 0;
	let word;
	let wordLength;

	$: {
		if (customizationChoices.subheading) {
			top = '';
			middle = '';
			bottom = '';
			placedCharacters = 0;

			arr = customizationChoices.subheading.split(' ');
			let newArr = [];

			// split long words
			for (let h=0; h<arr.length; h++) {
				if (arr[h].length > 10) {
					let subStr = arr[h].slice(10);
					let rootStr = arr[h].split(subStr)[0] + '-';

					if (subStr.length > 10) {
						let subSubStr = subStr.slice(10);
						let rootSubStr = subStr.split(subSubStr)[0] + '-';

						newArr.push(rootStr);
						newArr.push(rootSubStr);
						newArr.push(subSubStr);
					} else {
						newArr.push(rootStr);
						newArr.push(subStr);
					}
				} else {
					newArr.push(arr[h]);
				}
			}

			// ensure vertical centering when placing words
			for (let i=0; i<newArr.length; i++) {
				word = ` ${newArr[i]}`;
				wordLength = word.length;

				if (placedCharacters > 14 || placedCharacters + wordLength > 14) {
					if (bottom !== '') {
						if (bottom.length + wordLength > 14) {
							middle = bottom;
							bottom = word;
						} else {
							bottom += word;
						}
					} else {
						if (top.length == 0) {
							top = middle;
							middle = '';
							bottom = word;
						} else {
							middle += word;
						}
					}
				} else {
					middle += word;
				}

				placedCharacters += wordLength;
			}
		} else {
			top = 'Provider';
			middle = 'Organization';
			bottom = 'Name';
		}
	}

